import React from 'react';
import { useSelector } from 'react-redux';

import { MainDetailsDailyWeatherWrapper } from './styledComponents/DetailsDailyWeather';

const DetailsDailyWeather = () => {
  const state = useSelector((state) => state);
  const { weather } = state;

  return (
    <MainDetailsDailyWeatherWrapper>
      <div>
        temp :{Math.floor(weather?.main.temp)} feel likes {Math.floor(weather?.main.temp)}
        </div>
      <div>pressire: {weather?.main.pressure}</div>
      <div>precipitation: {weather?.weather[0].description}</div>
      <div>wind: {weather?.wind.speed}</div>
    </MainDetailsDailyWeatherWrapper>
  );
};

export default DetailsDailyWeather;
